  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Calhoun National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1947.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife including migratory birds, furbearers, and
  raptors is also covered. The public relations section of the report describes Refuge
  visitors and violations. Items of interest and NR forms are attached.\",\n\t\"license_title\":
